import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import "./ResultData.css";

export default function () {
  const [studentData, setStudentData] = useState([]);

  const showData = [
    "STT",
    "Trường Tiểu học",
    "Quận/Huyện",
    "Mã học sinh",
    "Lớp",
